import React from 'react';
import './Moon.css';
import { planets } from '../../constats'

const Moon = () => {
    console.log(planets)
    return (
        <div>
            {planets.map((planet) => (
                <div className='planet' key={planet.id}>{planet.title}</div>
            ))}
        </div>
    )
}

export default Moon;
